const initialState=[
    'My home playlist',
    'My work playlis'
  ]

export function playList(state = initialState, action) {
  if(action.type === 'ADD_PLAYLIST'){
    return state;
  }else if(action.type === 'DELETE_PLAYLIST'){
    return state;
  }
  return state;
}
